import requestsimport json# Define the API endpoint and parametersendpoint = "https://maps.googleapis.com/maps/api/place/textsearch/json"params = {    "query": "fuel stations in Ireland",    "key": "",    "page_token": ""}# Load existing data from filewith open("combinedFormattedStations.json", "r") as f:    existing_data = json.load(f)# Initialize a list to hold the new datanew_data = []while len(new_data) < 1000:    # Make the API request    response = requests.get(endpoint, params=params).json()    # Loop over the results and add new data to the list    for result in response["results"]:        # Check if this result is a duplicate        if result["name"] not in [station["name"] for station in existing_data]:            # If not, create a new data object with the desired format            data = {                "name": result["name"],                "address": result["formatted_address"],                "latitude": result["geometry"]["location"]["lat"],                "longitude": result["geometry"]["location"]["lng"],                "rating": result.get("rating", 0),                "county": result["plus_code"]["compound_code"].split(", ")[1],                "petrolPrice": 1.559,                "dieselPrice": 1.399            }            # Add the new data object to the list            new_data.append(data)    # Check if there are more pages of results    if "next_page_token" in response:        params["page_token"] = response["next_page_token"]    else:        break# Add the new data to the existing data and save to filewith open("combinedFormattedStations.json", "w") as f:    json.dump(existing_data + new_data, f, indent=2)